INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(60, 2, 'Bílý čaj', '&lt;p&gt;Bílý čaj&lt;br&gt;&lt;/p&gt;', 'Bílý čaj', '', ''),
(62, 1, 'Green tea', '&lt;p&gt;Green tea&lt;br&gt;&lt;/p&gt;', 'Green tea', '', ''),
(59, 1, 'Black tea', '', 'Black tea', '', ''),
(59, 2, 'Černý čaj', '', 'Černý čaj', '', ''),
(66, 2, 'Čaje', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Čaje', '', ''),
(67, 2, 'Oolong', '', 'Oolong', '', ''),
(67, 1, 'Oolong', '', 'Oolong', '', ''),
(68, 2, 'Čaj bez kofeinu', '', 'Čaj bez kofeinu', '', ''),
(68, 1, 'Decaffeinated tea', '', 'Decaffeinated tea', '', ''),
(61, 2, 'Nádobí', '&lt;p&gt;K práci s dobrými čaji jsou zapotřebí dobré nástroje: praktické, jednoduché, spolehlivé a estetické. Proto věnujeme výběru a výrobě nádobí velkou pozornost.&lt;/p&gt;&lt;p&gt;&amp;nbsp;V profesionální práci s čaji dáváme přednost průhlednému nádobí z borosilikátového skla – je trvanlivé, praktické, působivé samo o sobě a pomáhá ocenit krásu dobrého čaje.&lt;/p&gt;&lt;p&gt;Pracujeme se skleněným nádobím různého designu, a proto jsme schopni připravit čajový obřad v jakémkoliv stylu. Naše nádobí dobře ladí s nejrůznějšími interiéry, skvěle vypadá na venkovních akcích a výborně se hodí pro louhování a servírování čaje.&lt;/p&gt;&lt;p&gt;Zároveň stále zůstáváme u čajové klasiky – porcelánu a keramiky. Porcelánové a keramické nádobí vyrábíme často na individuální objednávku, některé vzorky nádobí byly původně navrženy pro nás. A jsou nádherné!&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', 'Nádobí', '', ''),
(61, 1, 'Dishes', '&lt;p&gt;To brew a good tea you need good tools: convenient, simple, reliable of tea-ware.&lt;/p&gt;&lt;p&gt;It is our pleasure to help you organize an excellent tea serving for large groups of guests at any venue: art and business exhibits, banquets, government and diplomatic meetings.&lt;/p&gt;&lt;p&gt;For professional use we prefer tea transparent utensils made of borosilicate glass, highly durable, comfortable, and eye-catching, allowing you to appreciate the beauty of tea.&lt;/p&gt;&lt;p&gt;We work with different design glassware and thus can devise tea parties in different styles. Our tea-ware fits well into any interior, looks great outdoors and is perfect for brewing and serving tea.&lt;/p&gt;&lt;p&gt;&amp;nbsp;But of course, we will never abandon the tea classics: porcelain and clay. We often make porcelain and pottery by special order, and some examples of tea ware were originally developed for us. It turned out beautifully!&lt;/p&gt;&lt;p&gt;In addition to professional ware, we like to work with artistic crockery that doesn’t sacrifice functionality. We have a rich collection of clay and stone kettles and are happy to compile unique collections of teapots for our clients.&lt;/p&gt;', 'Dishes', '', ''),
(69, 2, 'Akce', '', 'Akce', '', ''),
(69, 1, 'Sale', '', 'Sale', '', ''),
(62, 2, 'Zelený čaj', '&lt;p&gt;Zelený čaj&lt;br&gt;&lt;/p&gt;', 'Zelený čaj', '', ''),
(66, 1, 'Teas', '', 'Teas', '', ''),
(60, 1, 'White tea', '&lt;p&gt;White tea&lt;br&gt;&lt;/p&gt;', 'White tea', '', ''),
(70, 2, 'Vánoce', '', 'Vánoce', '', ''),
(70, 1, 'Christmas', '', 'Christmas', '', '');
