INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(70, 2, 'ROSE BLACK TEA', '&lt;p&gt;Tento aromatický ochucený černý čaj se sladkou voňavou anglickou růží je jedním z nejstarších čínských čajů. Čínský čaj je příjemně hladký, přirozeně sladký a vždy velmi osvěžující.&lt;/p&gt;&lt;p&gt;Země původu: Anhui, Čina&lt;/p&gt;&lt;p&gt;Druh čaje: černý&amp;nbsp;&lt;/p&gt;&lt;p&gt;Nálev: V nálevu si vychutnáte jak sílu černého čaje, tak i jeho decentní růžovou&amp;nbsp; chuť.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Obsah kofeinu : vysoký&amp;nbsp;&lt;/p&gt;&lt;p&gt;Způsob přípravy:&amp;nbsp;&lt;/p&gt;&lt;p&gt;Voda: 95°C&lt;/p&gt;&lt;p&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/p&gt;&lt;p&gt;Louhovat:&amp;nbsp; 4min - 5min&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Balení&lt;/p&gt;&lt;p&gt;100 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/p&gt;&lt;p&gt;100 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/p&gt;', '', 'ROSE BLACK TEA', '', ''),
(70, 1, 'ROSE BLACK TEA', '&lt;p&gt;DELICIOUSLY DELICATE AND SEDUCTIVELY SWEET, A SINGLE SIP BRINGS TO MIND ROLLING HILLS, CHURCH BELLS AND COUNTRY GARDENS: PERFECT FOR A PICNIC ON THE VILLAGE GREEN.&lt;/p&gt;&lt;p&gt;Origin: Anhui, China&lt;/p&gt;&lt;p&gt;Tea Type:&amp;nbsp; black&lt;/p&gt;&lt;p&gt;Tasting Note:&amp;nbsp; Woody, earthy and nutty, are all used to describe the aromas of Rooibos, add to that list tobacco and vanilla notes and you have a clear description of our rich, organic Rooibos.&lt;/p&gt;&lt;p&gt;&amp;nbsp;Caffeine Level: high&lt;/p&gt;&lt;p&gt;Steeping Instructions:&lt;/p&gt;&lt;p&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;Water Temperature:&amp;nbsp; 95*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Steeping Time First infusion 4 minutes, subsequent infusion about 5 minutes&lt;/p&gt;&lt;p&gt;Infusions: 2&lt;/p&gt;&lt;p&gt;Packaging style:&lt;/p&gt;&lt;p&gt;100 g loose leaf tea in boutique bag&lt;/p&gt;&lt;p&gt;100g loose leaf tea in cylindrical container&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;/p&gt;', '', 'ROSE BLACK TEA', '', ''),
(66, 2, 'DARJEELING BLACK', '&lt;p&gt;Vynikající darjeelingy platí za „šampaňské“ mezi čaji. Jejich nevtíravou, muškátovou chuť a nádhernou vůni má na svědomí jedinečná kombinace chladného, mlhavého podnebí, nadmořské výšky, srážek, terénu a kvality půdy a ovzduší.&lt;/p&gt;&lt;p&gt;Země původu: : Darjeeling, India&lt;/p&gt;&lt;p&gt;Druh čaje: black&lt;/p&gt;&lt;p&gt;&amp;nbsp;Nálev :&amp;nbsp; &amp;nbsp;Aroma je příjemně svěží, chuť nejprve nasládlá, pak svíravá a nakonec přichází závěr s ovocem a květinami.&lt;/p&gt;&lt;p&gt;Obsah kofeinu : vysoký&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Způsob přípravy:&amp;nbsp;&lt;/p&gt;&lt;p&gt;Voda: 95°C&lt;/p&gt;&lt;p&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/p&gt;&lt;p&gt;Louhovat:&amp;nbsp; 4min - 5min - 5min&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Balení&lt;/p&gt;&lt;p&gt;50 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/p&gt;&lt;p&gt;50 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/p&gt;', '', 'DARJEELING BLACK', '', ''),
(66, 1, 'DARJEELING BLACK', '&lt;p&gt;Darjeelings are called the champagne of teas. This tea is treasured for its rich golden liquor and distinctive muscatel flavor. Bright and aromatic, floral muscat grape aroma with notes of warm spice and sugary squash.&amp;nbsp; India&lt;/p&gt;&lt;p&gt;Origin: Darjeeling, India&lt;/p&gt;&lt;p&gt;Tea Type:&amp;nbsp; black&amp;nbsp;&lt;/p&gt;&lt;p&gt;Tasting Note:&amp;nbsp; Bright and aromatic, floral muscat grape aroma with notes of warm spice and sugary squash, fruity and flowering aftertaste.&lt;/p&gt;&lt;p&gt;&amp;nbsp;Caffeine Level: strong&lt;/p&gt;&lt;p&gt;Steeping Instructions:&lt;/p&gt;&lt;p&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;Water Temperature:&amp;nbsp; 95*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Steeping Time First infusions 4 minutes, subsequent infusions about 5 minutes&lt;/p&gt;&lt;p&gt;Infusions: 3&lt;/p&gt;&lt;p&gt;Packaging style:&lt;/p&gt;&lt;p&gt;50 g loose leaf tea in boutique bag&lt;/p&gt;&lt;p&gt;50g loose leaf tea in cylindrical container&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;/p&gt;', '', 'DARJEELING BLACK', '', ''),
(67, 2, 'ENGLISH BREAKFAST', '&lt;p&gt;Naš English breakfast zůstává v blízkosti klasiky. Vyrobeny z prvotřídního černého&amp;nbsp; čaje Keemun, ceněného pro svou bohatou, lehce kouřovou chuť . Velmi medová vůně. Můžete si vychutnat z kapkou mléka.&lt;/p&gt;&lt;p&gt;Země původu: Anhui,China&lt;/p&gt;&lt;p&gt;Druh čaje: černý&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;Nálev: Nálev má plnou medovou chuť a jasnou měděnou barvu.&lt;/p&gt;&lt;p&gt;Obsah kofeinu : vysoký&amp;nbsp;&lt;/p&gt;&lt;p&gt;Způsob přípravy:&amp;nbsp;&lt;/p&gt;&lt;p&gt;Voda: 95°C&lt;/p&gt;&lt;p&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/p&gt;&lt;p&gt;Louhovat:&amp;nbsp; 4min - 5min&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Balení&lt;/p&gt;&lt;p&gt;100 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/p&gt;&lt;p&gt;100 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/p&gt;', '', 'ENGLISH BREAKFAST', '', ''),
(67, 1, 'ENGLISH BREAKFAST', '&lt;p&gt;Our English Breakfast stays close to the classic. Made from top quality black Keemun tea, prized for its rich, slightly smoky flavor and perfectly \'on point\' astringency. Balanced, very honeyed aroma. May be enjoyed plain or with a drop of milk.&lt;/p&gt;&lt;p&gt;Origin: Anhui, China&lt;/p&gt;&lt;p&gt;Tea Type:&amp;nbsp; black&lt;/p&gt;&lt;p&gt;Tasting Note:&amp;nbsp; Full-bodied infusion with malty and oaky undertones, strong honey aftertaste&lt;/p&gt;&lt;p&gt;Caffeine Level: high&lt;/p&gt;&lt;p&gt;Steeping Instructions:&lt;/p&gt;&lt;p&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;Water Temperature:&amp;nbsp; 95*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Steeping Time First infusion 4 minutes, subsequent infusion about 5 minutes&lt;/p&gt;&lt;p&gt;Infusions: 2&lt;/p&gt;&lt;p&gt;Packaging style:&lt;/p&gt;&lt;p&gt;100 g loose leaf tea in boutique bag&lt;/p&gt;&lt;p&gt;100g loose leaf tea in cylindrical container&lt;/p&gt;&lt;p&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;br&gt;&lt;/p&gt;', '', 'ENGLISH BREAKFAST', '', ''),
(65, 2, 'YUNNAN BLACK', '&lt;p&gt;Kvalitnější sorta výrazného, aromatického, poměrně silně povzbuzujícího Yunnanského čaje. Nálev má zlatohnědou až hnědooranžovou barvu, plnou, jemně kouřovou chuť, místy připomínající nejrůznější koření.&lt;/p&gt;&lt;p&gt;Země původu: : Yunnan, Čína&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Druh čaje: černý&amp;nbsp;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Nálev :&amp;nbsp; &amp;nbsp; Nálev má oranžově-červenou barvu, chuť je jemná, plná, s tóny lehce do sušených meruněk, švestek a medu.&lt;/p&gt;&lt;p&gt;Obsah kofeinu : velký&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;Způsob přípravy:&amp;nbsp;&lt;/p&gt;&lt;p&gt;Voda: 95°C&lt;/p&gt;&lt;p&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/p&gt;&lt;p&gt;Louhovat:&amp;nbsp; 4min - 5min - 5min&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Balení&lt;/p&gt;&lt;p&gt;50 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/p&gt;&lt;p&gt;50 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/p&gt;', '', 'YUNNAN BLACK', '', ''),
(65, 1, 'YUNNAN BLACK', '&lt;p&gt;A high end gourmet black tea from Chin\'s Yunnan Province. When oxidized, these beautiful buds turn gold rather than black, resulting in a rich, smooth flavor. This tea is deliciously rich and malty, with lingering notes of chocolate and honey. Evokes a peppery sweetness&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Origin: Yunnan, China&lt;/p&gt;&lt;p&gt;Tea Type:&amp;nbsp; black&lt;/p&gt;&lt;p&gt;Tasting Note:&amp;nbsp; our high-grade Yunnan Gold is milk chocolate creamy and honey sweet, with pleasant pepper notes. The flavor becomes earthier and more layered as it cools.&lt;/p&gt;&lt;p&gt;Caffeine Level: high&lt;/p&gt;&lt;p&gt;Steeping Instructions:&lt;/p&gt;&lt;p&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;Water Temperature:&amp;nbsp; 95*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Steeping Time First infusions 4 minutes, subsequent infusions about 5minutes&lt;/p&gt;&lt;p&gt;Infusions: 3&lt;/p&gt;&lt;p&gt;Packaging style:&lt;/p&gt;&lt;p&gt;50 g loose leaf tea in boutique bag&lt;/p&gt;&lt;p&gt;50 g loose leaf tea in cylindrical container&lt;/p&gt;&lt;p&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;br&gt;&lt;/p&gt;', '', 'YUNNAN BLACK', '', ''),
(69, 2, 'LYCHEE BLACK TEA', '&lt;p&gt;Vyzkoušejte exotiku. Necháme-li čerstvě vymačkanou šťávu z tropického ovoce liči odpařovat přes čajové lístky, dostaneme velmi svěží po ovoci vonící sladký čaj.&lt;/p&gt;&lt;p&gt;Země původu: Anhui, Čina&lt;/p&gt;&lt;p&gt;Druh čaje: černý&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;Nálev: V nálevu si vychutnáte jak sílu černého čaje, tak i jedinečnou chuť a vůně líčí.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Obsah kofeinu : vysoký&amp;nbsp;&lt;/p&gt;&lt;p&gt;Způsob přípravy:&amp;nbsp;&lt;/p&gt;&lt;p&gt;Voda: 95°C&lt;/p&gt;&lt;p&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/p&gt;&lt;p&gt;Louhovat:&amp;nbsp; 4min - 5min&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Balení&lt;br&gt;&lt;/p&gt;&lt;p&gt;100 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/p&gt;&lt;p&gt;100 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/p&gt;', '', 'LYCHEE BLACK TEA', '', ''),
(69, 1, 'LYCHEE BLACK TEA', '&lt;p&gt;Go exotic. The lychee an indigenous fruit found in abundance in Southern China and Southeast Asia. Its natural sweetness and perfume pairs perfectly with black tea, creating a delicious and mild infusion that is as good served cold as it is served warm.&lt;/p&gt;&lt;p&gt;Origin: Anhui, China&lt;/p&gt;&lt;p&gt;Tea Type:&amp;nbsp; black&lt;/p&gt;&lt;p&gt;Tasting Note:&amp;nbsp; Fruity with a subtle sweetness. The light China tea is perfect with the ectravagant lychee fruit.&lt;/p&gt;&lt;p&gt;&amp;nbsp;Caffeine Level: high&lt;/p&gt;&lt;p&gt;Steeping Instructions:&lt;/p&gt;&lt;p&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;Water Temperature:&amp;nbsp; 95*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Steeping Time First infusion 4 minutes, subsequent infusion about 5 minutes&lt;/p&gt;&lt;p&gt;Infusions: 2&lt;/p&gt;&lt;p&gt;Packaging style:&lt;/p&gt;&lt;p&gt;100 g loose leaf tea in boutique bag&lt;/p&gt;&lt;p&gt;100g loose leaf tea in cylindrical container&lt;/p&gt;&lt;p&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;br&gt;&lt;/p&gt;', '', 'LYCHEE BLACK TEA', '', ''),
(56, 2, 'WHITE PEONY', '&lt;p style=&quot;padding: 0px 0px 16px; margin-bottom: 0px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Bilá pivoňka patří k nejvyšší sortě bílých čajů. Pro její výrobu&amp;nbsp; se sbírají bohatě ochmýřené listy a tipsy.&amp;nbsp; Čaj se vysuší na slunku, po čemž dostává pro všechny bílé čaje příznačnou sytou sladkou vůní a lehkou osvěžující chuť.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 16px; margin-bottom: 0px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Země původu: : Fu-ťien , Čína&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 16px; margin-bottom: 0px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Druh čaje: bilý&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 16px; margin-bottom: 0px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Nálev :&amp;nbsp; &amp;nbsp;Svěží, nasládle ovocná vůně vylouhovaného listu připomíná zralé jablko nebo sušené zahradní plody.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 16px; margin-bottom: 0px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Obsah kofeinu : nizký&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 16px; margin-bottom: 0px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Způsob přípravy:&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 16px; margin-bottom: 0px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Voda: 80°C&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 16px; margin-bottom: 0px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 16px; margin-bottom: 0px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Louhovat:&amp;nbsp; 3 -3min - 4min- 4min -5min&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 16px; margin-bottom: 0px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 16px; margin-bottom: 0px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Balení&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 16px; margin-bottom: 0px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;30 g&amp;nbsp; sypaného čaje v zipovém sáčku&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;padding: 0px 0px 16px; margin-bottom: 0px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;30 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;style&gt;\r\n&lt;!--\r\n /* Font Definitions */\r\n @font-face\r\n	{font-family:PMingLiU;\r\n	panose-1:2 2 5 0 0 0 0 0 0 0;\r\n	mso-font-alt:新細明體;\r\n	mso-font-charset:136;\r\n	mso-generic-font-family:roman;\r\n	mso-font-pitch:variable;\r\n	mso-font-signature:-1610611969 684719354 22 0 1048577 0;}\r\n@font-face\r\n	{font-family:&quot;Cambria Math&quot;;\r\n	panose-1:2 4 5 3 5 4 6 3 2 4;\r\n	mso-font-charset:0;\r\n	mso-generic-font-family:roman;\r\n	mso-font-pitch:variable;\r\n	mso-font-signature:-536870145 1107305727 0 0 415 0;}\r\n@font-face\r\n	{font-family:Calibri;\r\n	panose-1:2 15 5 2 2 2 4 3 2 4;\r\n	mso-font-charset:0;\r\n	mso-generic-font-family:swiss;\r\n	mso-font-pitch:variable;\r\n	mso-font-signature:-536859905 -1073732485 9 0 511 0;}\r\n@font-face\r\n	{font-family:&quot;Avenir Next Ultra Light&quot;;\r\n	panose-1:2 11 2 3 2 2 2 2 2 4;\r\n	mso-font-charset:77;\r\n	mso-generic-font-family:swiss;\r\n	mso-font-pitch:variable;\r\n	mso-font-signature:-2147483473 1342185546 0 0 155 0;}\r\n@font-face\r\n	{font-family:&quot;Nanum Myeongjo&quot;;\r\n	panose-1:2 11 6 4 2 2 2 2 2 4;\r\n	mso-font-charset:129;\r\n	mso-generic-font-family:auto;\r\n	mso-font-pitch:variable;\r\n	mso-font-signature:-2147482969 165149947 16 0 524289 0;}\r\n@font-face\r\n	{font-family:&quot;\\@Nanum Myeongjo&quot;;\r\n	mso-font-charset:129;\r\n	mso-generic-font-family:auto;\r\n	mso-font-pitch:variable;\r\n	mso-font-signature:-2147482969 165149947 16 0 524289 0;}\r\n@font-face\r\n	{font-family:&quot;\\@PMingLiU&quot;;\r\n	panose-1:2 1 6 1 0 1 1 1 1 1;\r\n	mso-font-charset:136;\r\n	mso-generic-font-family:roman;\r\n	mso-font-pitch:variable;\r\n	mso-font-signature:-1610611969 684719354 22 0 1048577 0;}\r\n /* Style Definitions */\r\n p.MsoNormal, li.MsoNormal, div.MsoNormal\r\n	{mso-style-unhide:no;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:&quot;&quot;;\r\n	margin:0cm;\r\n	margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:12.0pt;\r\n	font-family:&quot;Times New Roman&quot;,serif;\r\n	mso-fareast-font-family:Calibri;\r\n	mso-fareast-theme-font:minor-latin;\r\n	mso-ansi-language:EN-US;}\r\nspan.apple-converted-space\r\n	{mso-style-name:apple-converted-space;\r\n	mso-style-unhide:no;}\r\n.MsoChpDefault\r\n	{mso-style-type:export-only;\r\n	mso-default-props:yes;\r\n	font-family:&quot;Calibri&quot;,sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:Calibri;\r\n	mso-fareast-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:&quot;Times New Roman&quot;;\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-ansi-language:EN-US;}\r\n@page WordSection1\r\n	{size:612.0pt 792.0pt;\r\n	margin:70.85pt 70.85pt 70.85pt 70.85pt;\r\n	mso-header-margin:36.0pt;\r\n	mso-footer-margin:36.0pt;\r\n	mso-paper-source:0;}\r\ndiv.WordSection1\r\n	{page:WordSection1;}\r\n--&gt;\r\n&lt;/style&gt;', '', 'WHITE PEONY', 'WHITE PEONY', 'WHITE PEONY'),
(64, 2, 'MILK OOLONG', '&lt;p&gt;Velmi dobrý taiwanský Oolong, „čajové“ Baileys. Aroma mléčného karamelu nebo slazeného zahuštěného mléka. Chuť je teplá, měkká a příjemná. Neobsahuje&amp;nbsp; mléko!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Země původu: : Taiwan&lt;/p&gt;&lt;p&gt;Druh čaje: oolong&lt;/p&gt;&lt;p&gt;Nálev :&amp;nbsp; &amp;nbsp;nádherná vůně a chuť lahodného nálevu žlutavé barvy kombinující jemně plnou chuť oolongu s karamelovo - smetanovými tóny&lt;br&gt;&lt;/p&gt;&lt;p&gt;Obsah kofeinu : nizký&lt;br&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Způsob přípravy:&amp;nbsp;&lt;/p&gt;&lt;p&gt;Voda: 95°C&lt;/p&gt;&lt;p&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/p&gt;&lt;p&gt;Louhovat:&amp;nbsp; 3min - 4min-4min -4min- 4min&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Balení&amp;nbsp;&lt;/p&gt;&lt;p&gt;100 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/p&gt;&lt;p&gt;100 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/p&gt;', '', 'MILK OOLONG', '', ''),
(64, 1, 'MILK OOLONG', '&lt;p&gt;Milk oolong was named “Baileys tea” for its bright candied milky scent. The bright warm flavour of such tea gives a good feeling for the whole day, keeps a friendly conversation, and joy sweet and candy admirers. It does not contain milk!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Origin: Taiwan&lt;br&gt;&lt;/p&gt;&lt;p&gt;Tea Type:&amp;nbsp; Oolong&lt;/p&gt;&lt;p&gt;Tasting Note: light, buttery smooth brew with a sweet, milky, lightly roasted flavor!&lt;/p&gt;&lt;p&gt;Caffeine Level: Light&lt;/p&gt;&lt;p&gt;Steeping Instructions:&lt;/p&gt;&lt;p&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;Water Temperature:&amp;nbsp; 95*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Steeping Time First infusions 3 min, subsequent infusions about 4 minutes&lt;/p&gt;&lt;p&gt;Infusions: 5&lt;/p&gt;&lt;p&gt;Packaging style:&lt;/p&gt;&lt;p&gt;100 g loose leaf tea in boutique bag&lt;/p&gt;&lt;p&gt;100 g loose leaf tea in cylindrical container&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;/p&gt;', '', 'MILK OOLONG', '', ''),
(63, 2, 'OSMANTHUS OOLONG', '&lt;p&gt;Vysokohorský oolong ochucený květy osmanthu. Do čajových lístků se vloží čerstvé květy osmanthu, které dodají čaji sladce květinovou chuť i vůni.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Země původu: : Taiwan&lt;br&gt;&lt;/p&gt;&lt;p&gt;Druh čaje: oolong&lt;br&gt;&lt;/p&gt;&lt;p&gt;Nálev :&amp;nbsp; &amp;nbsp;fantastická vůně a chuť lahodného nálevu žlutavé barvy kombinující jemně plnou chuť oolongu s broskvovo - meruňkově květinovými tóny vonokvětky v kulatou jemnou s uklidňující nevtíravostí&lt;br&gt;&lt;/p&gt;&lt;p&gt;Obsah kofeinu : nizký&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Způsob přípravy:&amp;nbsp;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Voda: 95°C&lt;/p&gt;&lt;p&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/p&gt;&lt;p&gt;Louhovat:&amp;nbsp; 3 min - 4min - 4min-4min -4min&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Balení&amp;nbsp;&lt;/p&gt;&lt;p&gt;100 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/p&gt;&lt;p&gt;100 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/p&gt;', '', 'OSMANTHUS OOLONG', '', ''),
(63, 1, 'OSMANTHUS OOLONG', '&lt;p&gt;A deliciously aromatic oolong infused with finest osmanthus flowers. The scent of sweet flowers and dried apricots gives way to a soft, grassy taste and a smooth finish.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Origin: Taiwan&lt;/p&gt;&lt;p&gt;Tea Type:&amp;nbsp; Oolong&lt;/p&gt;&lt;p&gt;Tasting Note: Bright, sweet flavor; a fruity, floral aroma with hints of apples and apricots.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Caffeine Level: Light&lt;br&gt;&lt;/p&gt;&lt;p&gt;Steeping Instructions:&lt;/p&gt;&lt;p&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;Water Temperature:&amp;nbsp; 95*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Steeping Time First infusions 3 minutes, subsequent infusions about 4 minutes&lt;/p&gt;&lt;p&gt;Infusions: 5&lt;/p&gt;&lt;p&gt;Packaging style:&lt;/p&gt;&lt;p&gt;100 g loose leaf tea in boutique bag&lt;/p&gt;&lt;p&gt;100 g loose leaf tea in cylindrical container&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;/p&gt;', '', 'OSMANTHUS OOLONG', '', ''),
(68, 2, 'EARL GREY', '&lt;p&gt;Naš Čaj Earl Grey je připraven as špičkového čajů Ásámu s kvalitním olejem z bergamotu.&lt;/p&gt;&lt;p&gt;Země původu: Assam, India&lt;/p&gt;&lt;p&gt;Druh čaje: černý&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;Nálev: Nálev Earl Grey má příjemnou, tmavě měděnou barvu. V chuti i vůni vyniká bergamot – citrusové ovoce podobné citronu.&lt;/p&gt;&lt;p&gt;Obsah kofeinu : vysoký&amp;nbsp;&lt;/p&gt;&lt;p&gt;Způsob přípravy:&amp;nbsp;&lt;/p&gt;&lt;p&gt;Voda: 95°C&lt;/p&gt;&lt;p&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/p&gt;&lt;p&gt;Louhovat:&amp;nbsp; 4min - 5min&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Balení&lt;/p&gt;&lt;p&gt;100 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/p&gt;&lt;p&gt;100 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/p&gt;', '', 'EARL GREY', '', ''),
(68, 1, 'EARL GREY', '&lt;p&gt;Our Earl Grey is an exceptional blend of stunningly superb&amp;nbsp; Assam tea leaves infused with organic cold pressed Italian Bergamot oil from the citrus fruit grown in Bergamo, Italy.&lt;/p&gt;&lt;p&gt;Origin: Assam, India&lt;/p&gt;&lt;p&gt;Tea Type:&amp;nbsp; black&lt;/p&gt;&lt;p&gt;Tasting Note:&amp;nbsp; bright and balanced, with lively citrus freshening flavor with floral undertones on a full bodied base&lt;/p&gt;&lt;p&gt;&amp;nbsp;Caffeine Level: high&lt;/p&gt;&lt;p&gt;Steeping Instructions:&lt;/p&gt;&lt;p&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;Water Temperature:&amp;nbsp; 95*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Steeping Time First infusion 4 minutes, subsequent infusion about 5 minutes&lt;/p&gt;&lt;p&gt;Infusions: 2&lt;/p&gt;&lt;p&gt;Packaging style:&lt;/p&gt;&lt;p&gt;100 g loose leaf tea in boutique bag&lt;/p&gt;&lt;p&gt;100g loose leaf tea in cylindrical container&lt;/p&gt;&lt;p&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;br&gt;&lt;/p&gt;', '', 'EARL GREY', '', ''),
(50, 2, 'WAY TO NATURE', '&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Jde o koncepci zdravého životního stylu založenou na spojení fyzického a mentálního zdraví, správné životosprávy, rozumné fyzické aktivity a zbavení se zlozvyků. Way to nature je skvělou alternativou pro lidi s kontraindikací kofeinu.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Složení: citronová tráva, ananasove kostky, měsíček, sušené mrazem granuly citronu, sušené mrazem jahody.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Země původu: : Německo&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Druh čaje: wellness&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Nálev :&amp;nbsp; Jahoda a exotické ovoce dělají celistvou chuť a vytváří nezapomenutelný nádech tohoto čaje&lt;/span&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Obsah kofeinu : 0&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Způsob přípravy:&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Voda: 100°C&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Louhovat:&amp;nbsp; 5 min - 5min&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Balení&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;50 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;50 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 'WAY TO NATURE', '', ''),
(50, 1, 'WAY TO NATURE', '&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Our wellness collection includes all-natural, organic herbal teas. Apart from having a beneficial effect on health, Way to nature tea contains a natural fragrance and beauty. High in vitamin C as well as other minerals, herbal tea is full of health benefits and is perfect for everyday consumption. Immune-boosting tea.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Ingredients: lemon grass, apple pieces, pineapple cubes (pineapple, sugar), marigold blossoms, freeze­dried lemon granules (fruit (lemon juice), sucrose, natural lemon oil), freeze­dried strawberry pieces.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Origin: Germany&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Tea Type:&amp;nbsp; wellness&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Tasting Note:&amp;nbsp; exotic and unforgettable.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Caffeine Level: 0&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Steeping Instructions:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &am