(54, 1, 'SWEET PASSION', '&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Selected fruits from nature have been composed to a colourful mixture, which is symbolic of everything that is summer: ripe strawberries, mellow raspberries, fresh and sour hibiscus and aromatic blackberries.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Ingredients: elderberries, hibiscus blossoms, apple pieces, blackcurrants, freeze­dried blackberries, freeze­dried strawberry and raspberry pieces, wild strawberry leaves.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Origin: Germany&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Tea Type:&amp;nbsp; fruit tea&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Tasting Note:&amp;nbsp; All these aromatic treasures of sweet, tangy and delicious fruits and berries on a colourful and appetizing fruit tea blend let the dreams of childhood live again! INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(51, 2, 'ON A WAVES OF HARMONY', '&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Uklidňující čaj&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Jde o koncepci zdravého životního stylu založenou na spojení fyzického a mentálního zdraví, správné životosprávy, rozumné fyzické aktivity a zbavení se zlozvyků. On a wave of harmony je skvělou alternativou pro lidi s kontraindikací kofeinu.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Složení: máta, eukalipt, měsíček, růží ,jablko,&amp;nbsp; List ostružiny, zázvor, Citronová Kůra.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Země původu: : Německo&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Druh čaje: wellness&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Nálev :&amp;nbsp; Velmi prijemny&amp;nbsp; uklidňující nápoj.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Obsah kofeinu : 0&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Způsob přípravy:&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Voda: 100°C&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&