(55, 2, 'SILVER NEEDLE', '&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Tento vysoce kvalitní bílý čaj je špičkovou ukázkou toho, proč je nejlepší dát přednost opravdu kvalitnímu čínskému čaji. Vyniká svou jemnou chutí, která má charakter lehce smetanový. Je složen pouze z mladých ochmýřených pupenů, které se mohou sbírat pouze několik dní v roce. Jde tak o čaj poměrně vzácný&lt;/span&gt;&lt;/font&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Země původu: Fu-ťien , Čína&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Druh čaje: bilý&lt;/span&gt;&lt;/font&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Nálev :&amp;nbsp; &amp;nbsp;Chuť je slaměnková, nasládlá, máslová, nakouřená, na konci se stopami jablečných slupek. Dochuť je sladká, svěží.&lt;/span&gt;&lt;/font&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Obsah kofeinu : nizký&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Způsob přípravy:&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Voda: 75-80°C&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Množství:&amp;nbsp; 1g/100ml&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Louhovat:&amp;nbsp; 3 min - 3min - 4min- 4min-&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Balení&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;30 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;30 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 'SILVER NEEDLE', '', ''),
(55, 1, 'SILVER NEEDLE', '&lt;p&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Rarity and fame cloak our legendary Silver Needle white tea downy buds. Reserved for the Chinese Imperial family for centuries, this tea is reverently hand-harvested only two days of the entire year. The leaves are uniquely beautiful and silver tipped exuding royalty and an exceptional soft, smooth, sweet-silky luxuriousness.&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Origin:&amp;nbsp;&lt;/span&gt;&lt;a href=&quot;https://en.wikipedia.org/wiki/Zhejiang&quot; style=&quot;box-sizing: content-box; margin: 0px; padding: 0px; border: 0px; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;Fuding&lt;/font&gt;&lt;/a&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;, China&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Tea Type: White&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Tasting Note: Elegant, delicate and fragrance of orchids.&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Caffeine Level: Light&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Steeping Instructions:&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Quantity: 1 gramm per 100ml of water&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Water Temperature: 75-80*&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Steeping Time First infusions 3 minute, subsequent infusions about 4 minutes&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Infusions: 4&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Packaging style:&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;30 g loose leaf tea in boutique bag&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;30 g loose leaf tea in cylindric conteiner&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;You might also like:&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;White Peony, Milk oolong, osmanthus oolong, dragon Well, special tea cup&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'SILVER NEEDLE', '', ''),
(56, 1, 'WHITE PEONY', '&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;White Peony tea is a kind of slightly fermented white tea. It creates a fresh mellow sweet taste, without astringency, compensated with some grassy flavor just like the sunny air taste in countryside after rainy days.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Origin: Fuding, China&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Tea Type:&amp;nbsp; White&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Tasting Note:&amp;nbsp; has a light and delicate taste that produces sweet and mild vegetal tones.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Caffeine Level: Light&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Steeping Instructions:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Water Temperature:&amp;nbsp; 80*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Steeping Time First infusions 3 min, subsequent infusions about 4&amp;nbsp; and 5 minutes&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Infusions: 5&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Packaging style:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;30 g loose leaf tea in boutique bag&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;30 g loose leaf tea in cylindrical container&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; padding: 0px 0px 16px; -webkit-tap-highlight-color: transparent !important;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'WHITE PEONY', '', ''),
(57, 2, 'DRAČÍ STUDNA', '&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Longjing nebo dračí studna je králem čínských zelených čajů. Nálev žlutozelené barvy s hutným aromatem, připomínajícím orchideje, a čerstvou výraznou chutí. Podle čajové tradice tyto čtyři vlastnosti určují dokonalost: zelená barva, hezká vůně, výrazná chuť a skvělá forma.&lt;/span&gt;&lt;/font&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Země původu: Če—ťiang , Čína&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Druh čaje: zelený&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Nálev :&amp;nbsp; :&amp;nbsp; ve vůni vylouhovaného listu naleznete lehce pražené oříšky (sacha inchi) a mladé jarní lusky, nálev s čerstvou výraznou chutí&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Obsah kofeinu : střední&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Způsob přípravy:&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Voda: 75-80°C&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Množství:&amp;nbsp; 1g/ 100 ml&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Louhovat:&amp;nbsp; 3min - 3min - 4min- - 5min&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Balení&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;50 g&amp;nbsp; sypaného čaje v zipovém sáčku&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;50 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 'DRAGON WELL', '', ''),
(57, 1, 'DRAGON WELL', '&lt;p&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Dragon Well green tea is regarded as one of China\'s top teas, and is often served to visiting head\'s of states. Hand-flattened jade-green leaves create a mellow-sweet taste with chestnut overtones. It is the Dragon Well Tea, world famous for its four wonders - emerald green color, aromatic flavor, sweet taste and beautiful appearance.&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Origin: Zhejiang, China&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Tea Type: Green&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Tasting Note: Surprisingly buttery, with each subsequent infusion the texture becomes fuller and nuttier with a creamy but sweet finish.&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Caffeine Level: Middle&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Steeping Instructions:&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Quantity: 1 gramm per 100ml of water&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Water Temperature: 75-80*&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Steeping Time: First infusion, 3 minutes, subsequent infusions 4 minutes&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Infusions: 4&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Packaging style:&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;50 g loose leaf tea in boutique bag&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;50 g loose leaf tea in cylindrical container&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'DRAGON WELL', '', ''),
(58, 1, 'JAPANESE SENCHA', '&lt;p&gt;Sencha is a traditional steamed green tea from Japan. Sencha\'s bright green infusion has a refreshing energy with a balance of juicy-sweet flavor, deep umami, and a crisp, refreshing finish.&lt;/p&gt;&lt;p&gt;Origin: Japan&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Tea Type:&amp;nbsp; Green&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Tasting Note:&amp;nbsp; sweetness, and grassy flavour with resinous aroma and minimal astringency.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;Caffeine Level: Middle&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Steeping Instructions:&lt;/p&gt;&lt;p&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;Water Temperature:&amp;nbsp; 70*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Steeping TimeFirst infusions 2 minutes, subsequent infusions about 3 minutes&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Infusions: 5&lt;/p&gt;&lt;p&gt;Packaging style:&lt;br&gt;&lt;/p&gt;&lt;p&gt;100 g loose leaf tea in boutique bag&lt;br&gt;&lt;/p&gt;&lt;p&gt;100 g loose leaf tea in cylindrical container&lt;br&gt;&lt;/p&gt;&lt;p&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;br&gt;&lt;/p&gt;', '', 'JAPANESE SENCHA', '', ''),
(59, 2, 'JASMINE GREEN', '&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Jasmínový čaj patří mezi nejoblíbenější květinové čaje. Vyrábí se v Číně a v posledních letech se těší oblibě i u nás. Kombinace zeleného čaje a jasmínu se příjemně doplňuje a díky tomu má čaj báječnou chuť i vůni.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Země původu: : Jiangxi , Čína&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Druh čaje: zelený&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Nálev:&amp;nbsp; Čaj má kvalitní a plnou ovocně nasládlou chuť. Příjemná vám bude i vůně jasmínu&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Obsah kofeinu : nizký&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Způsob přípravy:&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Voda: 75-80°C&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Louhovat:&amp;nbsp; 3 - 3min - 4min-&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Balení&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;100 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;100 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 'JASMINE GREEN', '', ''),
