(60, 2, 'JASMÍNOVÉ DRAČÍ PERLY', '&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Jasmínové dračí perly se řadí k nejoblíbenějším čínským ochuceným čajům. Vyznačuje se tenkými a slabě ochmýřenými čajovými lístky těsně svinutými do malých kuliček s velmi intenzivní jasmínovou vůní&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Země původu: Jiangxi , Čína&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;DRUH ČAJE: zelený&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Nálev :&amp;nbsp; lehká, mírně nasládlá, květinová a nutí k dalšímu napití. Můžete v ní najít i smetanový nádech.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Obsah kofeinu : nizký&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Způsob přípravy:&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Voda: 75-80°C&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Množství:&amp;nbsp; 1g/ 100 ml&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Louhovat:&amp;nbsp; 3min - 3min - 4min- - 4min- 5min&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Balení&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt