s-serif; font-size: 14px;&quot;&gt;Quantity: 1 gramm per 100ml of water&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Water Temperature: 75-80*&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Steeping Time: First infusion, 3 minutes, subsequent infusions 4 minutes&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Infusions: 5&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Packaging style:&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;100 g loose leaf tea in boutique bag&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;50 g loose leaf tea in cylindrical container&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;You might also like:&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;box-sizing: content-box; font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Jasmine green tea, dragon well, milk oolong, special tea cup&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'JASMINE DRAGON PEARLS', '', ''),
(61, 2, 'GINSENG OOLONG', '&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Tento unikátní čaj s přidaným Ženšenem roste na vysokohorských plantážích provincie Yunnan. Účinky Ženšenu jsou legendární a čaj se Ženšenem je jeden z nejpopulárnějších aromatických čajů v Asii.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Země původu: : Taiwan&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Druh čaje: oolong&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Nálev :&amp;nbsp; &amp;nbsp;. Chuťi dominuje nezvyklá sladkost v kombinaci s nezaměnitelným aroma Žen Šenu a svěžími travnatými podtóny. Dozvuk je hořkosladký.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Obsah kofeinu : střední&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Způsob přípravy:&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Voda: 95°C&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Louhovat:&amp;nbsp; 3 min - 4min - 4min-4min -4min&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Balení&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;100 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;100 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 'GINSENG OOLONG', '', ''),
(61, 1, 'GINSENG OOLONG', '&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Ginseng oolong is made by tightly compressing oolong tea leaves with powdered ginseng and licorice grass into tiny tea tablets. When infused, the tea is amber in color with a delicious and mesmerizing sweet ginseng aroma. Its rich taste and its sweet aftertaste makes it a favorite of young and old alike&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;Origin: Taiwan&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Tea Type:&amp;nbsp; oolong&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Tasting Note:&amp;nbsp; This tea has the rich, crisp taste of oolong with a stronger, pleasing aftertaste. The aroma is fragrant and the hue is golden-brown.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;Caffeine Level: Middle&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Steeping Instructions:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Water Temperature:&amp;nbsp; 95*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Steeping Time First infusions 3 minutes, subsequent infusions about 4 minutes&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Infusions: 5&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Packaging style:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;100 g loose leaf tea in boutique bag&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Roboto, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;100 g loose leaf tea in cylindrical container&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;/span&gt;&lt;/p&gt;', '', 'GINSENG OOLONG', '', ''),
(58, 2, 'JAPONSKÁ SENCHA', '&lt;p&gt;Japonská Sencha je lahoda sama. Zelený čaj špičkové kvality je hrou příjemné trávové chuti s květovou nasládlostí a silně trávovou dochutí. Svíravost je lehká, nevtíravá. Nálev zanechává pocit velmi svěží chuti se stopou voňavých květů.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Země původu: : Yamato, Japonsko&lt;br&gt;&lt;/p&gt;&lt;p&gt;Druh čaje: zelený&lt;br&gt;&lt;/p&gt;&lt;p&gt;Nálev :&amp;nbsp; &amp;nbsp;je hrou příjemné trávové chuti s květovou nasládlostí a silně trávovou dochutí.&lt;br&gt;&lt;/p&gt;&lt;p&gt;Obsah kofeinu : střední&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Způsob přípravy:&amp;nbsp;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Voda: 75°C&lt;/p&gt;&lt;p&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/p&gt;&lt;p&gt;Louhovat:&amp;nbsp; 2 min - 3min - 3min-3min -3min&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Balení&amp;nbsp;&lt;br&gt;&lt;/p&gt;&lt;p&gt;100 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/p&gt;&lt;p&gt;100 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/p&gt;', '', 'JAPONSKÁ SENCHA', '', ''),
(71, 2, 'IMPERIAL SHU PUER', '&lt;p&gt;V dávných dobách pu-erh patřil mezi nejvybranější čajové sorty, které byly podávány pouze čínským císařům. Měkká sametová chuť, tmavě rudý hutný nálev, ořechové aroma a příjemný uklidňující účinek – to jsou hlavní specifické vlastnosti tohoto čaje.&lt;/p&gt;&lt;p&gt;Země původu: Yunnan, Čina&lt;/p&gt;&lt;p&gt;Druh čaje: černý&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;Nálev: . Chuť je pestrá, liší se způsobem zpracování čaje i samotnou přípravou.&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Obsah kofeinu : vysoký&amp;nbsp;&lt;/p&gt;&lt;p&gt;Způsob přípravy:&amp;nbsp;&lt;/p&gt;&lt;p&gt;Voda: 95°C&lt;/p&gt;&lt;p&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/p&gt;&lt;p&gt;Louhovat:&amp;nbsp; 4min - 5min – 5 min – 5min – 5 min&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Balení&lt;/p&gt;&lt;p&gt;100 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/p&gt;&lt;p&gt;100 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/p&gt;', '', 'IMPERIAL SHU PUER', '', ''),
(71, 1, 'IMPERIAL SHU PUER', '&lt;p&gt;Imperial Shu Pu-erh is a black tea made from early-picked leaves that undergo a unique post fermentation and aging process. Its flavor is rich, strong, and earthy, with an intense aroma well-liked by coffee drinkers&lt;/p&gt;&lt;p&gt;Origin: Yunnan, China&lt;/p&gt;&lt;p&gt;Tea Type:&amp;nbsp; black&lt;/p&gt;&lt;p&gt;Tasting Note:&amp;nbsp; . Its earthy notes are beautifully balanced by a fresh, clean sweetness, and are noted for being highly refreshing. It is Full bodied, rich and extremely smooth in taste.&lt;/p&gt;&lt;p&gt;&amp;nbsp;Caffeine Level: high&lt;/p&gt;&lt;p&gt;Steeping Instructions:&lt;/p&gt;&lt;p&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;Water Temperature:&amp;nbsp; 95*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Steeping Time First infusion 4 minutes, subsequent infusion about 5 minutes&lt;/p&gt;&lt;p&gt;Infusions: 5&lt;/p&gt;&lt;p&gt;Packaging style:&lt;/p&gt;&lt;p&gt;100 g loose leaf tea in boutique bag&lt;/p&gt;&lt;p&gt;100g loose leaf tea in cylindrical container&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;/p&gt;', '', 'IMPERIAL SHU PUER', '', ''),
(72, 2, 'MAOFEN', '&lt;p&gt;Zelený čaj Maofen je čínský čaj příjemně natrpklé osvěžující chuti. Maofen je jeden z nejznámějších druhů zeleného čaje pocházejícího z Číny. Má jemnou chuť’ apřekrásný vzhled.&lt;/p&gt;&lt;p&gt;Země původu: Anhui , Čína&lt;br&gt;&lt;/p&gt;&lt;p&gt;Druh čaje: zelený&lt;br&gt;&lt;/p&gt;&lt;p&gt;Nálev :&amp;nbsp; :&amp;nbsp; Nálev voní po magnoliích, je čirý, světle zelený, chuti velejemné.&lt;br&gt;&lt;/p&gt;&lt;p&gt;Obsah kofeinu : střední&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Způsob přípravy:&amp;nbsp;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Voda: 75-80°C&lt;/p&gt;&lt;p&gt;Množství:&amp;nbsp; 1g/ 100 ml&lt;/p&gt;&lt;p&gt;Louhovat:&amp;nbsp; 3min - 3min - 4min- - 5min-&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Balení&amp;nbsp;&lt;/p&gt;&lt;p&gt;50 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/p&gt;&lt;p&gt;50 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/p&gt;', '', 'MAOFEN', '', ''),
(72, 1, 'MAOFEN', '&lt;p&gt;A smooth and subtle green tea known for its delicately rolled and shaped leaves. The leaves are picked only in the spring when they are very young and only contain a bud and a single unfolding leaf.&lt;/p&gt;&lt;p&gt;Origin Anhui, China&lt;/p&gt;&lt;p&gt;Tea Type:&amp;nbsp; Green&lt;/p&gt;&lt;p&gt;Tasting Note: Flavour notes of plum and florals, very gentle.&lt;/p&gt;&lt;p&gt;Caffeine Level: Middle&lt;/p&gt;&lt;p&gt;Steeping Instructions:&lt;/p&gt;&lt;p&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;Water Temperature:&amp;nbsp; 75-80*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Steeping Time:&amp;nbsp; First infusion, 3 minutes, subsequent infusions 4 minutes&lt;/p&gt;&lt;p&gt;Infusions: 4&lt;/p&gt;&lt;p&gt;Packaging style:&lt;/p&gt;&lt;p&gt;50 g loose leaf tea in boutique bag 130&lt;/p&gt;&lt;p&gt;50 g loose leaf tea in cylindrical container&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;/p&gt;', '', 'MAOFEN', '', ''),
(73, 2, 'LAPSANG SOUCHONG', '&lt;p&gt;Oblíbený uzený čaj vás zahřeje v sychravých dnech. Volně svinutý, tmavý, delší list silně kouřové až uzené vůně, tmavý nálev zcela svébytné, výrazně uzené chuti s lehkou čajovou složkou, velmi povzbuzujícího účinku.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Země původu: : Fujian, Čína&amp;nbsp;&lt;/p&gt;&lt;p&gt;Druh čaje: černý&amp;nbsp;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Nálev :&amp;nbsp; &amp;nbsp; Nálev má šedohnědou barvu s fialovými a bronzovými odstíny. Na první přivonění je zřetelně zakouřený, avšak hned po prvním vjemu odhalíte vůni sladkých brambor, tabákového listu a třešňového likéru.&lt;/p&gt;&lt;p&gt;Obsah kofeinu : velký&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Způsob přípravy:&amp;nbsp;&lt;/p&gt;&lt;p&gt;Voda: 95°C&lt;/p&gt;&lt;p&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/p&gt;&lt;p&gt;Louhovat:&amp;nbsp; 4min - 5min - 5min&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Balení&lt;/p&gt;&lt;p&gt;100 g&amp;nbsp; sypaného čaje v zipovém sáčku&amp;nbsp;&lt;/p&gt;&lt;p&gt;100 g sypaného čaje v&amp;nbsp; elegantní papirové doze&lt;/p&gt;', '', 'LAPSANG SOUCHONG', '', ''),
(73, 1, 'LAPSANG SOUCHONG', '&lt;p&gt;Lapsang Souchong a unique type of tea because the leaves are traditionally smoke- dried over pinewood fires, taking on a distinctive smoky flavor. If you like single-malt whisky and fine cigars, then this is the tea for you.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Origin: Yunnan, China&lt;br&gt;&lt;/p&gt;&lt;p&gt;Tea Type:&amp;nbsp; black&lt;/p&gt;&lt;p&gt;Tasting Note:&amp;nbsp; The aroma is much like sitting by an open fire: smoky, warming and comforting.&lt;/p&gt;&lt;p&gt;Caffeine Level: high&lt;/p&gt;&lt;p&gt;Steeping Instructions:&lt;/p&gt;&lt;p&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;Water Temperature:&amp;nbsp; 95*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Steeping Time First infusions 4 minutes, subsequent infusions about 5minutes&lt;/p&gt;&lt;p&gt;Infusions: 3&lt;/p&gt;&lt;p&gt;Packaging style:&lt;/p&gt;&lt;p&gt;100 g loose leaf tea in boutique bag&lt;/p&gt;&lt;p&gt;100 g loose leaf tea in cylindrical container&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;/p&gt;', '', 'LAPSANG SOUCHONG', '', ''),
(74, 2, 'Da hong pao', '&lt;p&gt;Velké rudé roucho, legendární čaj pocházející z Číny, který se může pyšnit bezesporu jedním z nejzajímavějších příběhů a původem. Tento čaj se v Číněobvykle podává při návštěvě velmi vážených hostů.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Země původu: : Wui, Čína&amp;nbsp;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Druh čaje: tmavý oolong&lt;br&gt;&lt;/p&gt;&lt;p&gt;Nálev :&amp;nbsp; &amp;nbsp; Plná chuť čaje Da Hung Pao totiž ve vašem hrdle zanechá příjemně nasládlou vzpomínku připomínající květy, a to už prakticky po jediném malém šálku.&lt;br&gt;&lt;/p&gt;&lt;p&gt;Obsah kofeinu : velký&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Způsob přípravy:&amp;nbsp;&lt;/p&gt;&lt;p&gt;Voda: 95°C&lt;/p&gt;&lt;p&gt;Množství:&amp;nbsp; 1g/100 ml&lt;/p&gt;&lt;p&gt;Louhovat:&amp;nbsp; 4min - 5min - 5min&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Balení&lt;/p&gt;&lt;p&gt;50 g&amp;nbsp; sypaného čaje v zipovém sáčku&lt;/p&gt;&lt;p&gt;50 g sypaného čaje v&amp;nbsp; elegantní papirové doze&amp;nbsp;&lt;/p&gt;', '', 'Da hong pao', '', ''),
(74, 1, 'Da hong pao', '&lt;p&gt;Da Hong Pao (Big Red Robe) is a Wuyi rock tea grown in the Wuyi Mountains. It is a heavily oxidized, dark oolong tea. Legendary history and taste.&lt;/p&gt;&lt;p&gt;Due to its high quality, Da Hong Pao tea is usually reserved for honored guests in China.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Origin: Whui Rocks, China&lt;br&gt;&lt;/p&gt;&lt;p&gt;Tea Type:&amp;nbsp; dark oolong&lt;/p&gt;&lt;p&gt;Tasting Note:&amp;nbsp; &amp;nbsp;Da Hong Pao has a strong flavour. The amber liquid gives off sweet aromas with a woody flair. The taste is smokey, yet smooth. Hints of a honey flavour are also present.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Caffeine Level: high&lt;br&gt;&lt;/p&gt;&lt;p&gt;Steeping Instructions:&lt;/p&gt;&lt;p&gt;Quantity: 1 gramm per 100ml of water&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;&lt;p&gt;Water Temperature:&amp;nbsp; 95*&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Steeping Time First infusions 4 minutes, subsequent infusions about 5minutes&lt;/p&gt;&lt;p&gt;Infusions: 3&lt;/p&gt;&lt;p&gt;Packaging style:&lt;/p&gt;&lt;p&gt;50 g loose leaf tea in boutique bag&lt;/p&gt;&lt;p&gt;50 g loose leaf tea in cylindrical container&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Tea connoisseurs often first clean tea leaves of dust and particles by steeping it in the suggested temperature for no more than 30 seconds and discarding the rinse water.&lt;/p&gt;', '', 'Da hong pao', '', ''),
(76, 2, 'Termoska 400 ml', '', '', 'Termoska 400 ml', '', ''),
(76, 1, 'Thermo Bottle 400 ml', '&lt;p&gt;The double-glazed thermos is made of heat-resistant glass and washable in dishwashers.&lt;/p&gt;&lt;p&gt;&amp;nbsp;The vacuum gap in the double wall of the glass significantly improves its insulating properties and prevents condensation on the outer surface.&lt;br&gt;&lt;/p&gt;', '', 'Thermo Bottle 400 ml', '', ''),
(78, 2, 'Cajová kazeta', '&lt;p&gt;Luxusní čajovy presenter na 24 porci čaju.&amp;nbsp;&lt;/p&gt;', '', 'Cajová kazeta', '', ''),
(79, 2, 'Hrnek 90 ml', '&lt;p&gt;&lt;span id=&quot;docs-internal-guid-084ec76f-7fff-961d-5788-5a5308fe304c&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot; style=&quot;line-height:1.38;margin-top:0pt;margin-bottom:14pt;&quot;&gt;&lt;span style=&quot;font-size:10.5pt;font-family:Arial;color:#666666;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;&quot;&gt;Hrnek je vyroben ze skla odolného proti vysokým teplotám a proti náhlým změnám teplot. Hrnek můžete použít na teplé nebo studené nápoje. Sklo odolá při použití v mikrovlnné troubě nebo myčce na nádobí.&lt;/span&gt;&lt;/p&gt;', '', 'Hrnek 90 ml', '', ''),
(83, 2, 'Konvice 400 ml', '&lt;p&gt;Tělo konvice je vyráběno ze strojově foukaného brosilikátového varného skla.&lt;/p&gt;&lt;p&gt;Nerezový filtr se skleněným víčkem je určený k louhování sypaného čaje nebo bylinek.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Konvici z varného skla s vynikajícími termodynamickými vlastnostmi je možné používat přímo na zdroj tepla.&lt;/p&gt;&lt;p&gt;Sklo neobsahuje žádné těžké kovy ani jiné toxické látky.&lt;/p&gt;', '', 'Konvice 400 ml', '', ''),
(83, 1, 'Teapot 400 ml', '&lt;p&gt;The&amp;nbsp; body of the&amp;nbsp; teapot is made from machine-blown brosilicate glass.&lt;/p&gt;&lt;p&gt;The stainless steel filter with a&amp;nbsp; lid is designed to infuse&amp;nbsp; loose tea or herbs.&lt;br&gt;&lt;/p&gt;&lt;p&gt;The glass does not contain any heavy metals or other toxic substances.&lt;br&gt;&lt;/p&gt;&lt;p&gt;Convenient, elegant and trustworthy.&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 'Teapot 400 ml', '', ''),
(79, 1, 'Mug 90 ml', '&lt;p&gt;The mug is made of high temperature resistant glass a. You can use the mug for hot or cold drinks. Glass can withstand microwave or dishwasher.&lt;/p&gt;', '', 'Mug 90 ml', '', ''),
(80, 2, 'Dubové Prkno', '&lt;p&gt;Proč ne servírovat doma čaj jako v restaurací? S našim hezkym prkinkem bude to ale jednoduché.&lt;/p&gt;', '', 'Dubové Prkno', '', ''),
(80, 1, ' Oak plank', '&lt;p&gt;Why not serve tea at home like in a restaurant? But with our nice stuff, it will be easy.&lt;/p&gt;', '', ' Oak plank', '', ''),
(78, 1, 'Tea chest', '&lt;p&gt;Luxury tea presenter for 24 tea portions.&lt;/p&gt;', '', 'Tea chest', '', ''),
(77, 2, 'Šálek 3 v 1', '&lt;p&gt;Skleneny salek s sitem 300 ml, kvalintne sklo&lt;/p&gt;', '', 'Šálek 3 v 1', '', ''),
(77, 1, 'Cup 3 in 1', '&lt;p&gt;&amp;nbsp;High quality cup with a glass strainer. Infuse and drink using just one piece&lt;br&gt;&lt;/p&gt;', '', 'Cup 3 in 1', '', ''),
(86, 2, 'Christmas blend by White Peony', '&lt;div class=&quot;gmail_default&quot; style=&quot;color: rgb(34, 34, 34); font-size: small; font-family: verdana, sans-serif;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Calibri, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-origin: initial; background-clip: initial; font-size: 14px;&quot;&gt;Okamžitě po otevření tohoto čaje budete obklopeni neodolatelnými zimními vůněmi muškátového oříšku, sladce pikantní skořice a horkým pepřem, kterým napomáhá orientální kardamon, hřebík a med. Lahodná chuť tohoto lákavého čajového mixu je skutečným zjevením. Chut’ koření s perníkem je ideální pro chladnou sezónu.&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;div class=&quot;gmail_default&quot; style=&quot;color: rgb(34, 34, 34); font-size: small; font-family: verdana, sans-serif;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Calibri, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-origin: initial; background-clip: initial; font-size: 12pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 14px; font-family: Calibri, sans-serif;&quot;&gt;Složení: Rooibos čaj, pomerančová kůra, fenykl, kořen lékořice, anýz, anyzové hvězdíčky, saflor a přírodní aromatizátory.&lt;/span&gt;&lt;/div&gt;&lt;p class=&quot;m_5909188601035569550m_8142698316734779862gmail-MsoListParagraph&quot; style=&quot;color: rgb(34, 34, 34); margin: 0cm 0cm 0.0001pt 36pt; line-height: 13.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-origin: initial; background-clip: initial; font-size: 11pt; font-family: Calibri, sans-serif;&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 12pt; color: black;&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;div class=&quot;gmail_default&quot; style=&quot;color: rgb(34, 34, 34); font-size: small; font-family: verdana, sans-serif;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div class=&quot;gmail_default&quot; style=&quot;font-size: small; font-family: verdana, sans-serif;&quot;&gt;&lt;p style=&quot;margin-bottom: 10px; font-family: &amp;quot;Open Sans&amp;quot;, sans-serif; font-size: 12px;&quot;&gt;&lt;span style=&quot;font-family: Roboto, sans-serif; font-size: 14px;&quot;&gt;Balení&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px; font-family: Roboto, sans-serif;&quot;&gt;100 g&lt;/span&gt;&lt;/p&gt;&lt;/div&gt;', '', 'Christmas blend by White Peony', '', ''),
(86, 1, 'Christmas blend by White Peony', '', '', 'Christmas blend by White Peony', '', '');
