INSERT INTO `oc_theme` (`theme_id`, `store_id`, `theme`, `route`, `code`, `date_added`) VALUES
(73, 0, 'default', 'common/menu', '{#{% if categories %}#}\n  {#&lt;nav id=&quot;menu&quot; class=&quot;navbar&quot;&gt;#}\n    {#&lt;div class=&quot;navbar-header&quot;&gt;&lt;span id=&quot;category&quot; class=&quot;visible-xs&quot;&gt;{{ text_category }}&lt;/span&gt;#}\n      {#&lt;button type=&quot;button&quot; class=&quot;btn btn-navbar navbar-toggle&quot; data-toggle=&quot;collapse&quot; data-target=&quot;.navbar-ex1-collapse&quot;&gt;&lt;i class=&quot;fa fa-bars&quot;&gt;&lt;/i&gt;&lt;/button&gt;#}\n    {#&lt;/div&gt;#}\n    {#&lt;div class=&quot;collapse navbar-collapse navbar-ex1-collapse&quot;&gt;#}\n      {#&lt;ul class=&quot;nav navbar-nav&quot;&gt;#}\n        {#{% for category in categories %}#}\n        {#{% if category.children %}#}\n        {#&lt;li class=&quot;dropdown&quot;&gt;&lt;a href=&quot;{{ category.href }}&quot; class=&quot;dropdown-toggle&quot; data-toggle=&quot;dropdown&quot;&gt;{{ category.name }}&lt;/a&gt;#}\n          {#&lt;div class=&quot;dropdown-menu&quot;&gt;#}\n            {#&lt;div class=&quot;dropdown-inner&quot;&gt; {% for children in category.children|batch(category.children|length / category.column|round(1, \'ceil\')) %}#}\n              {#&lt;ul class=&quot;list-unstyled&quot;&gt;#}\n                {#{% for child in children %}#}\n                {#&lt;li&gt;&lt;a href=&quot;{{ child.href }}&quot;&gt;{{ child.name }}&lt;/a&gt;&lt;/li&gt;#}\n                {#{% endfor %}#}\n              {#&lt;/ul&gt;#}\n              {#{% endfor %}&lt;/div&gt;#}\n            {#&lt;a href=&quot;{{ category.href }}&quot; class=&quot;see-all&quot;&gt;{{ text_all }} {{ category.name }}&lt;/a&gt; &lt;/div&gt;#}\n        {#&lt;/li&gt;#}\n        {#{% else %}#}\n        {#&lt;li&gt;&lt;a href=&quot;{{ category.href }}&quot;&gt;{{ category.name }}&lt;/a&gt;&lt;/li&gt;#}\n        {#{% endif %}#}\n        {#{% endfor %}#}\n      {#&lt;/ul&gt;#}\n    {#&lt;/div&gt;#}\n  {#&lt;/nav&gt;#}\n{#{% endif %}#}\n&lt;nav id=&quot;menu&quot; class=&quot;navbar&quot;&gt;\n    &lt;div class=&quot;navbar-header&quot;&gt;&lt;span id=&quot;category&quot; class=&quot;visible-xs&quot;&gt;{{ text_category }}&lt;/span&gt;\n      &lt;button type=&quot;button&quot; class=&quot;btn btn-navbar navbar-toggle&quot; data-toggle=&quot;collapse&quot; data-target=&quot;.navbar-ex1-collapse&quot;&gt;&lt;i class=&quot;fa fa-bars&quot;&gt;&lt;/i&gt;&lt;/button&gt;\n    &lt;/div&gt;\n    &lt;div class=&quot;collapse navbar-collapse navbar-ex1-collapse&quot;&gt;\n      &lt;ul class=&quot;nav navbar-nav&quot;&gt;\n        &lt;li&gt;&lt;a href=&quot;http://whitepeony.eu/uvod&quot;&gt;Úvod&lt;/a&gt;&lt;/li&gt;\n        &lt;li&gt;&lt;a href=&quot;https://eshop.whitepeony.eu&quot;&gt;Eshop&lt;/a&gt;&lt;/li&gt;\n        &lt;li&gt;&lt;a href=&quot;http://whitepeony.eu/onas&quot;&gt;O nás&lt;/a&gt;&lt;/li&gt;\n&lt;!--        &lt;li&gt;\n          &lt;a href=&quot;{{ home }}&quot;&gt;\n            &lt;img src=&quot;{{ logo }}&quot; title=&quot;{{ name }}&quot; alt=&quot;{{ name }}&quot; /&gt;\n          &lt;/a&gt;\n        &lt;/li&gt;--&gt;\n        &lt;li&gt;&lt;a href=&quot;http://whitepeony.eu/kontakt&quot;&gt;Kontakt&lt;/a&gt;&lt;/li&gt;\n        &lt;li&gt;&lt;a href=&quot;/index.php?route=checkout/cart&quot; class=&quot;cart-btn&quot;&gt;CART&lt;/a&gt;&lt;/li&gt;\n      &lt;/ul&gt;\n    &lt;/div&gt;\n&lt;/nav&gt;', '2018-11-21 15:18:19'),
(146, 0, 'default', 'common/home', '{{ header }}\n\n\n&lt;div id=&quot;common-home&quot; class=&quot;container&quot;&gt;\n\n    &lt;ul class=&quot;nav nav-tabs&quot;&gt;\n        {% for category in categories %}\n        &lt;li {% if loop.index == chosen_tab %} class=&quot;active&quot; {% endif %}&gt;\n                &lt;a data-toggle=&quot;tab&quot; href=&quot;#cat{{ category.category_id }}&quot;&gt;\n                    &lt;h4 class=&quot;category-name-tab&quot;&gt;\n                    {{ category.name }}\n                    &lt;/h4&gt;\n                &lt;/a&gt;\n\n        &lt;/li&gt;\n        {% endfor %}\n    &lt;/ul&gt;\n\n  \n\n  \n    &lt;div class=&quot;tab-content&quot;&gt;\n        {% for category in categories %}\n        &lt;div id=&quot;cat{{ category.category_id }}&quot; class=&quot;tab-pane fade {% if loop.index == chosen_tab %} in active {% endif %}&quot;&gt;\n            {#&lt;h3&gt;{{ category.name }}&lt;/h3&gt;#}\n            &lt;ul class=&quot;filter_row&quot;&gt;\n            {% for subcategory in category.categories %}\n                &lt;li class=&quot;category_filter&quot;&gt;\n                    &lt;input class=&quot;filter_checkbox&quot; type=&quot;checkbox&quot;  name=&quot;selected[]&quot; checked value=&quot;{{ subcategory.category_id }}&quot;&gt;\n                    &lt;div &gt;{{ subcategory.name }}&lt;/div&gt;\n                &lt;/li&gt;\n            {% endfor %}\n            &lt;/ul&gt;\n            {% if category.description %}\n            &lt;div style=&quot;font-size:15px;&quot;&gt;{{ category.description }}&lt;/div&gt;\n            {% endif %}\n            {% for subcategory in category.categories %}\n                &lt;div id=&quot;row_cat{{ subcategory.category_id }}&quot;class=&quot;row category-row&quot;&gt;\n                    {#&lt;a href=&quot;{{ subcategory.href }}&quot;&gt;&lt;h4 class=&quot;category-name&quot;&gt;{{ subcategory.name }}&lt;/h4&gt;&lt;/a&gt;#}\n                    {% if subcategory.description %}\n            	&lt;div style=&quot;font-size:15px;&quot;&gt;{{ subcategory.description }}&lt;/div&gt;\n                    {% endif %}\n                    {% for product in subcategory.products %}\n                        &lt;div class=&quot;product-layout col-lg-3 col-md-3 col-sm-6 col-xs-12&quot;&gt;\n                            &lt;div class=&quot;product-thumb transition&quot;&gt;\n                                &lt;div class=&quot;image&quot;&gt;&lt;a href=&quot;{{ product.href }}&quot;&gt;&lt;img src=&quot;{{ product.thumb }}&quot; alt=&quot;{{ product.name }}&quot; title=&quot;{{ product.name }}&quot; class=&quot;img-responsive&quot; /&gt;&lt;/a&gt;&lt;/div&gt;\n                                &lt;div class=&quot;caption&quot;&gt;\n                                    &lt;h4&gt;&lt;a href=&quot;{{ product.href }}&quot;&gt;  {{ product.name }}&lt;/a&gt;&lt;/h4&gt;\n                                &lt;/div&gt;\n                            &lt;/div&gt;\n                        &lt;/div&gt;\n                    {% endfor %}\n                &lt;/div&gt;\n            {% endfor %}\n\n            {% for product in category.products %}\n                &lt;div class=&quot;product-layout col-lg-3 col-md-3 col-sm-6 col-xs-12&quot;&gt;\n                    &lt;div class=&quot;product-thumb transition&quot;&gt;\n\n                        &lt;div class=&quot;image&quot;&gt;&lt;a href=&quot;{{ product.href }}&quot;&gt;&lt;img src=&quot;{{ product.thumb }}&quot; alt=&quot;{{ product.name }}&quot; title=&quot;{{ product.name }}&quot; class=&quot;img-responsive&quot; /&gt;&lt;/a&gt;&lt;/div&gt;\n                        &lt;div class=&quot;caption&quot;&gt;\n                            &lt;h4&gt;\n&lt;a href=&quot;{{ product.href }}&quot;&gt;     {{ product.name }}&lt;/a&gt;&lt;/h4&gt;\n                        &lt;/div&gt;\n                    &lt;/div&gt;\n                &lt;/div&gt;\n            {% endfor %}\n        &lt;/div&gt;\n        {% endfor %}\n    &lt;/div&gt;\n\n&lt;/div&gt;\n{{ footer }}', '2019-01-21 10:38:33');
